import ExpenseItem from './components/ExpenseItem';

function App() {
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem expenseTitle="PS5 Tax" price="25"></ExpenseItem>
      <ExpenseItem expenseTitle="Tv License" price="50"></ExpenseItem>
      <ExpenseItem expenseTitle="Dog Food"price="15"></ExpenseItem>
    </div>
  );
}

export default App;
